import React from "react";
import {useState,useEffect} from 'react';

function Catalog(props){
    console.log(props);
    const [data, setData] = useState({});
    useEffect(()=>{
    fetch("/catalog").then(
        res=>res.json())
        .then(data=>setData(data));
    },[]);
    console.log(data);
    return(
        <div>
            {data.map(function(d){
                return (<li>{d.name}</li> )
            })}
        </div>
    );
}
export default Catalog;
